      "content": "// SPDX-License-Identifier: MIT
// solhint-disable-next-line
pragma solidity ^0.8.0;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
import "./IFunctionInterface.sol";
import "./Library.sol";

import "hardhat/console.sol";

contract COEConverter {
  address public aegToken;
  address public wAegToken;
  address public cards;
  address public ethernals;
  address public adventurers;
  address public emotes;
  address public cardBacks;
  address public paymentReceiver;
  bool public paused;

  AggregatorV3Interface public aegUsdPriceFeed;

  event ConvertedCards(
    address indexed _assetAddress,
    address indexed _userAddress,
    uint256[] _ids,
    uint256[] _amounts
  );

  // address _emotes
  constructor(
    address _aegToken,
    address _wAegToken,
    address _cards,
    address _ethernals,
    address _adventurers,
    address _emotes,
    address _cardBacks,
    address _aegUsdPriceFeed // Address of the AEG/USD Chainlink price feed
  ) {
    aegUsdPriceFeed = AggregatorV3Interface(_aegUsdPriceFeed);
    aegToken = _aegToken;
    wAegToken = _wAegToken;
    cards = _cards;
    ethernals = _ethernals;
    adventurers = _adventurers;
    emotes = _emotes;
    cardBacks = _cardBacks;
    paymentReceiver = msg.sender;
    roles[OWNER][msg.sender] = true;
    roles[ADMIN][msg.sender] = true;
  }

  function convertPrice(
    uint256 _price, //ethernal example is 20000, which is $20
    address _paymentToken
  ) public view returns (uint256) {
    uint256 decimals = FunctionInterface(_paymentToken).decimals();
    uint256 decimalsDifference = 18 - decimals;
    if (_paymentToken == wAegToken) {
      console.log("wAegToken");
      console.log("price", _price);
      console.log("decimals", decimals);

      return ((_price * 10 ** decimals)) / 45;
    } else if (_paymentToken == aegToken) {
      //need to use chainlink price feed for AEG/USD - AEG is also 18 decimals

      uint256 aegUsdCurrentPrice = getAegUsdPrice(decimals); //should be returned converted to the same decimals as the payment token's decimals
      //returns 545625190000000000 for $0.54562519

      return ((_price * 10 ** (decimals - 3) * 10 ** decimals) /
        aegUsdCurrentPrice); // -3 to account for the decimal precision for cents //returns 36000.. instead of 36756.... so it should be 36.756aeg but it returns 36aeg equivalent
    } else {
      revert("Invalid payment token");
    }
  }

  function convertAssets(
    address _assetAddress,
    address _userAddress,
    address _paymentToken,
    uint256[] memory _ids, // types (IG ID NOT TOKEN ID)
    uint256[] memory _amounts,
    uint256 _price, // (ex. 45 = $0.045, 500 = $0.5, 1000 = $1, 10000 = $10) //SEND CALCULATED PRICE
    bool _sb
  ) external onlyRole(ADMIN) whenNotPaused {
    require(_ids.length == _amounts.length, "Invalid input");

    //check that the address is one of the four
    require(
      _assetAddress == cards ||
        _assetAddress == ethernals ||
        _assetAddress == adventurers ||
        _assetAddress == emotes ||
        _assetAddress == cardBacks,
      "Invalid asset address"
    );

    console.log("price: %s", _price);

    uint256 convertedPrice = convertPrice(_price, _paymentToken);

    console.log("convertedPrice: %s", convertedPrice);

    //tranfer AEG/wAEG from user to this contrac
    require(
      AEGInterface(_paymentToken).balanceOf(_userAddress) >= convertedPrice,
      "Not enough AEG tokens"
    );

    // Transfer the AEG tokens from the user to the contract
    AEGInterface(_paymentToken).transferFrom(
      _userAddress,
      paymentReceiver,
      convertedPrice
    );

    for (uint256 i = 0; i < _ids.length; i++) {
      _convertAsset(_assetAddress, _userAddress, _ids[i], _amounts[i], _sb);
    }

    emit ConvertedCards(_assetAddress, _userAddress, _ids, _amounts);
  }

  function _convertAsset(
    address _assetAddress,
    address _userAddress,
    uint256 _type,
    uint256 _amount,
    bool _sb
  ) private {
    console.log("type: %s", _type);
    if (_assetAddress == cards) {
      (, , bool exists, Library.Rarity rarity, bool isPromo) = CardInterface(
        _assetAddress
      ).types(_type);

      console.log("exists: ", exists);
      console.log("isPromo: ", isPromo);

      require(exists, "Invalid type");
      require(!isPromo, "Cannot convert promo assets");
      require(rarity != Library.Rarity.Basic, "Cannot convert basic assets");
      NftInterface(_assetAddress).adminMint(
        _userAddress,
        _type,
        1,
        _amount,
        _sb
      );
    } else if (_assetAddress == emotes) {
      (, , bool exists) = EmotesInterface(_assetAddress).types(_type);

      console.log("exists: ", exists);
      require(exists, "Invalid type");
      EmotesInterface(_assetAddress).adminMint(
        _userAddress,
        _type,
        _amount,
        _sb
      );
    } else {
      (, , , bool exists) = NftInterface(_assetAddress).types(_type);

      console.log("exists: ", exists);
      require(exists, "Invalid type");
      NftInterface(_assetAddress).adminMint(
        _userAddress,
        _type,
        1,
        _amount,
        _sb
      );
    }
  }

  // ---------------------------- SETTERS ----------------------------

  function setAegToken(address _aegToken) external onlyRole(OWNER) {
    aegToken = _aegToken;
  }

  function setWAegToken(address _wAegToken) external onlyRole(OWNER) {
    wAegToken = _wAegToken;
  }

  function setPaused(bool _paused) external onlyRole(OWNER) {
    paused = _paused;
  }

  function setAegUsdPriceFeed(
    address _aegUsdPriceFeed
  ) external onlyRole(OWNER) {
    aegUsdPriceFeed = AggregatorV3Interface(_aegUsdPriceFeed);
  }

  function setCards(address _cards) external onlyRole(OWNER) {
    cards = _cards;
  }

  function setEthernals(address _ethernals) external onlyRole(OWNER) {
    ethernals = _ethernals;
  }

  function setAdventurers(address _adventurers) external onlyRole(OWNER) {
    adventurers = _adventurers;
  }

  function setEmotes(address _emotes) external onlyRole(OWNER) {
    emotes = _emotes;
  }

  function setCardBacks(address _cardBacks) external onlyRole(OWNER) {
    cardBacks = _cardBacks;
  }

  function setPaymentReceiver(
    address _paymentReceiver
  ) external onlyRole(OWNER) {
    paymentReceiver = _paymentReceiver;
  }

  // ACCESS CONTROL ----------------------------

  mapping(bytes32 => mapping(address => bool)) private roles;
  bytes32 private constant ADMIN = keccak256(abi.encodePacked("ADMIN"));
  bytes32 private constant OWNER = keccak256(abi.encodePacked("OWNER"));

  modifier whenNotPaused() {
    require(!paused, "Contract is paused");
    _;
  }

  modifier onlyRole(bytes32 role) {
    require(roles[role][msg.sender], "Not authorized to converter.");
    _;
  }

  function grantRole(bytes32 role, address account) public onlyRole(OWNER) {
    roles[role][account] = true;
  }

  function revokeRole(bytes32 role, address account) public onlyRole(OWNER) {
    roles[role][account] = false;
  }

  function transferOwnership(address newOwner) external onlyRole(OWNER) {
    grantRole(OWNER, newOwner);
    grantRole(ADMIN, newOwner);
    revokeRole(OWNER, msg.sender);
    revokeRole(ADMIN, msg.sender);
    paymentReceiver = newOwner;
  }

  // ---------------------------- GETTERS ----------------------------

  function getAegUsdPrice(
    uint256 targetDecimals
  ) public view returns (uint256) {
    (, int256 price, , , ) = aegUsdPriceFeed.latestRoundData();
    require(price > 0, "Invalid price");

    uint256 rawPrice = uint256(price);
    uint256 feedDecimals = aegUsdPriceFeed.decimals();

    if (feedDecimals < targetDecimals) {
      return rawPrice * (10 ** (targetDecimals - feedDecimals));
    } else if (feedDecimals > targetDecimals) {
      return rawPrice / (10 ** (feedDecimals - targetDecimals));
    } else {
      return rawPrice;
    }
  }

  function withdraw() public onlyRole(OWNER) {
    require(address(this).balance > 0, "Balance is zero");
    payable(msg.sender).transfer(address(this).balance);
  }
}
