// solhint-disable-next-line
pragma solidity ^0.8.0;

import "./Library.sol";

interface AEGInterface {
  function balanceOf(address) external view returns (uint256);

  function transferFrom(address, address, uint256) external;
}

interface NftInterface {
  function adminMint(
    address _to,
    uint256 _type,
    uint256 _level,
    uint256 _amount,
    bool _sb
  ) external;

  function ownerOf(uint256) external view returns (address);

  function totalTypes() external view returns (uint256);

  function types(
    uint256 _id
  ) external view returns (string memory, uint256, Library.Rarity, bool);
}

interface EmotesInterface {
  function types(
    uint256 _id
  ) external view returns (string memory, uint256, bool);

  function adminMint(
    address _to,
    uint256 _type,
    uint256 _amount,
    bool _sb
  ) external;
}

interface CardInterface {
  function types(
    uint256 _id
  ) external view returns (string memory, uint256, bool, Library.Rarity, bool);

  function packMint(address, uint256[] memory, bool) external;

  function promoTypes() external view returns (uint256[] memory);

  function getRarityToCardTypes(
    Library.Rarity
  ) external view returns (uint256[] memory);
}

interface FunctionInterface {
  function fpMint(address, uint256, uint256) external;

  function burn(uint256) external;

  function totalTokens() external view returns (uint256);

  function transfer(address, uint256) external;

  function decimals() external view returns (uint8);

  function purchaseWithToken(uint256, address, address) external;

  function trim(
    uint256,
    uint256[] memory
  ) external pure returns (uint256[] memory);

  function burn(address, uint256, uint256) external;

  function balanceOf(address, uint256) external view returns (uint256);
}
